import React, { useState, useEffect } from 'react';

const UserDashboard = ({ userData }) => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!userData) {
      // userData is null, don't proceed
      return;
    }

    const fetchUserById = async () => {
      try {
        // The user ID is assumed to be part of the userData
        const response = await fetch(`/users/${userData.id}`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (response.ok) {
          const data = await response.json();
          console.log('User data:', data.user);

          // The user data should already be available in the userData prop
          // Update the user data state (optional)
          // setUserData(data.user);

          setLoading(false);
        } else {
          console.error('Error fetching user data:', response.statusText);
          setError('Error fetching user data.');
          setLoading(false);
        }
      } catch (error) {
        console.error('Error fetching user:', error);
        setError('Something went wrong. Please try again.');
        setLoading(false);
      }
    };

    fetchUserById();
  }, [userData]);

  return (
    <div>
      <h1>User Dashboard</h1>
      {loading && <p>Loading user data...</p>}
      {error && <p>{error}</p>}
      {userData && (
        <div>
          <h2>User Information</h2>
          <p>ID: {userData.id}</p>
          <p>First Name: {userData.first_name}</p>
          <p>Last Name: {userData.last_name}</p>
          <p>Username: {userData.username}</p>
          <p>Email: {userData.email}</p>
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
